(504, 14, 203, '', 'EMPANADAS DE CARNE', 'Sabrosas y calentitas, no te las podés perder. Son una excelente elección como entrada para que abra el apetito mientras esperamos lo que viene. Nuestra recomendación es degustarlas con un delicioso malbec.', '220.00', '180.00', 0, 0, 0, 0, 0, 0),
(505, 14, 203, '', 'PROVOLETA', 'Sale antes o durante el asado, según los tiempos del parrillero. Es muy común que se la condimente con especias que le dan un excelente aroma y la convierten en tentadoras para cualquier comensal.', '420.00', '350.00', 0, 0, 0, 0, 0, 0),
(506, 14, 203, '', 'MORCILLA CRIOLLA', 'Nuestras mejores entradas salen de la parrilla, y ahí no puede faltar la morcilla, que por lo general se sirve al principio de la parrillada junto con otros embutidos. Rica y nutritiva, se la puede acompañar con un crocante pan de campo.', '350.00', '0.00', 0, 0, 0, 0, 0, 0),
(507, 14, 203, '', 'CHORIZO CRIOLLO DE RUEDA', 'Una de las especialidades de la casa que impacta a primera vista por su forma y tamaño. Un clásico irresistible de las parrillas argentinas, ideal para degustar con un aperitivo y una rica ensalada antes del plato principal.', '350.00', '0.00', 0, 0, 0, 0, 0, 0),
(508, 14, 204, '', 'ESPECIAL', 'Jamón cocido, morrones, aceituna, huevo y muzzarella.', '429.00', '255.00', 0, 0, 0, 0, 0, 0),
