(511, 14, 204, '', 'MUZZARELLA', 'Salsa de tomate, aceitunas, orégano y doble muzza.', '330.00', '299.00', 0, 0, 0, 0, 0, 0),
(512, 14, 204, '', 'POLLO Y CHAMPI', 'Dados de pollo, champi, morrones y muzzarella.', '350.00', '0.00', 0, 0, 0, 0, 0, 0),
(513, 14, 204, '', 'VEGGIE', 'Vegetariana con vegetales de estación.\r\n\r\n', '370.00', '350.00', 0, 0, 0, 0, 0, 0),
(514, 14, 205, '', 'PAPAS CRIOLLAS CON HUEVOS REVUELTOS', 'Para acompañar una buena porción de carne o simplemente disfrutarlas con un pan crocante.\r\nLa papa cortada al estilo criollo, en finas rodajas, con unos huevos revueltos que transformarán tu paladar en un festival de sabores.', '330.00', '0.00', 0, 0, 0, 0, 0, 0),
(515, 14, 205, '', 'ENSALADA COMBINADA PALTA, PALMITOS Y TOMATE', 'La frescura de vegetales que equilibran los sabores de tu plato acompaña muy bien a cualquier corte de carne.\r\nUna entrada que gusta demasiado y en muchos casos puede transformarse en protagonista y requerida por los comensales.', '270.00', '0.00', 0, 0, 0, 0, 0, 0),
(516, 14, 205, '', 'PAPAS FRITAS', 'Las clásicas papas fritas crocantes por fuera y tiernas por dentro que no pueden faltar en la mesa de los argentinos.', '220.00', '0.00', 0, 0, 0, 0, 0, 0),
(517, 14, 205, '', 'ENSALADA CAESAR', 'Lechuga, croutons de pan, pollo, panceta y crema de limón.\r\nCompleta y deliciosa, una entrada que podría transformarse en tu plato principal.\r\nSus ingredientes le dan una excelente textura, y el grado de crocante acompaña al buen sabor en general.\r\nPara disfrutar y compartir en tu mesa.', '280.00', '0.00', 0, 0, 0, 0, 0, 0),
(518, 14, 205, '', 'ENSALADA CAPRESE', 'Tomate, mozzarella y albahaca.\r\nUna opción mediterránea con un aroma particular realza el sabor general de tu plato.\r\nLa frescura de este mix de vegetales que le dan buen color y acompaña cualquier tipo de carnes o la comida que vos prefieras compartir.', '270.00', '200.00', 0, 0, 0, 0, 0, 0),
(519, 14, 205, '', 'HUEVOS A LA PLANCHA CON MORRÓN ASADO', 'Sin dudas que cuando decidimos sumarlo a nuestra carta fue pensando en una opción diferente.\r\nUna deliciosa guarnición de huevos a la plancha en pareja con morrones finamente asados, especiales para combinar con un jugoso corte de carne.', '330.00', '250.00', 0, 0, 0, 0, 0, 0),
(520, 14, 206, '', 'FUSSILLI CASEROS CON OLIVA', 'Fussilli caseros con oliva, tomates secos, tomate concasse y albahaca.\r\nPara comer hasta el final y disfrutar la salsa pasando el pancito.\r\nLa tradición de la pasta italiana llega a tu mesa y te traslada en el tiempo para recordar aquellas recetas mágicas de la nonna que con tanto cariño preparaba.', '430.00', '0.00', 0, 0, 0, 0, 0, 0),
(521, 14, 206, '', 'RAVIOLES DE MOZZARELLA Y JAMÓN', 'Ravioles de mozzarella y jamón con salsa de albahaca, crema y tomate concasse.\r\nPasta de tradición italiana elaborada con los productos más frescos para lograr un relleno de excelente calidad.\r\nIntentamos transmitir esos secretos guardados de la nonna para que la familia reunida en la mesa pueda descubrirlos.', '470.00', '0.00', 0, 0, 0, 0, 0, 0),
