(550, 14, 211, '', 'LA LINDA MALBEC', 'Característico color rojo intenso. Aromas a guinda y especias. En boca se perciben taninos equilibrados. Aterciopelado. De buena estructura, fino, moderno.', '450.00', '0.00', 0, 0, 0, 0, 0, 0),
