(1553, 91, 584, '', 'BOMBONES X 20 UNIDADES', 'Características:\r\nLa mejor selección de bombones de chocolate surtidos en una exclusiva presentación.\r\n\r\nPresentación:\r\nCaja x20 Unidades.', '0.00', '0.00', 0, 0, 0, 0, 0, 0),
(1554, 91, 591, '', 'FRAPPÉS HAVANNA', 'Frappé de Chocolate: Combinación helada de crema de chocolate Havanna, espresso y leche, cubierto con crema batida, salsa de chocolate y medallón.\r\n\r\nFrappé de Dulce de Leche: Combinación helada de dulce de leche, espresso y leche, cubierto con crema batida, salsa de dulce de leche y alfajor de nuez.\r\nFrappé de Tramontana: Combinación helada de crema tramontana Havanna, espresso, medallón y leche, cubierto con crema batida, salsa de dulce de leche y pedacitos de alfajor de chocolate\r\n\r\nY dos sabores frutales naturales y muy refrescantes:\r\n\r\nFrappé de frutos rojos: Combinación helada de frambuesa, frutilla y arándanos.\r\n\r\nFrappé de Durazno y Naranja: Combinación helada de durazno, naranja y limón.', '0.00', '0.00', 0, 0, 0, 0, 0, 0),
(1555, 91, 589, '', 'HAIREADO DE PECETO Y BARBACOA', 'Sándwich de tapas aireadas de trigo relleno de peceto, queso cheddar y salsa barbacoa.', '0.00', '0.00', 0, 0, 0, 0, 0, 0),
(1556, 91, 589, '', 'HAIREADO DE VEGETALES', 'Sándwich de tapas aireadas de harina integral relleno de vegetales grillados, quesos provolone y danbo y mix de semillas.', '0.00', '0.00', 0, 0, 0, 0, 0, 0),
