(1587, 97, 619, '', 'LOLA MONTES MALBEC', 'De color rojo rubí con reflejos violáceos. Es fácil de tomar, fluye ligero con sabores de frutas rojas y bayas. Se nota la presencia de cerezas y frutillas en primer plano junto a tonos de especias dulces. Es de cuerpo medio, jugoso y expresivo.s. La textura es refrescante en boca y tiene aromas de frutos rojos en primer plano como cerezas, frutillas y ciruelas frescas. También brinda un delicado dejo floral que recuerda a las golosinas. Es de paladar seco y sabroso y fluye equilibrado, delicado y refrescante.', '590.00', '0.00', 0, 0, 0, 0, 0, 0),
