(1680, 101, 639, '', 'MARINE CREAM 50G', 'Crema humectante y vitalizante, para usar en todo el rostro durante todo el día.\nCategoría: Plasma Anti-age', '0.00', '0.00', 0, 0, 0, 0, 0, 0),
(1681, 97, 640, '', 'MOUSE DE CHOCOLATE', '<br>', '150.00', '0.00', 0, 0, 0, 0, 0, 0),
