(1684, 101, 635, '', 'PLASMA INFUSION FACE ENERGY', 'Crema muy liviana y fresca que combina la potencia y la efectividad de los activos que brindan una intensa protección frente a los cambios celulares producidos por el envejecimiento, con el altísimo poder de hidratación del ácido hialurónico de ultra bajo peso molecular biovectorizado.\r\nOtorga energía y vitalidad a las pieles de todo tipo, incluso las más grasas. Indicada en pieles jóvenes como tratamiento preventivo. ', '1700.00', '1440.00', 0, 2, 0, 0, 0, 0),
(1685, 101, 642, '', 'HIGIENE FACIAL', 'La limpieza de cutis es una rutina indispensable tanto para la higiene como para mantener la piel del rostro más luminosa  debido a que los factores externos como la contaminación ambiental y los internos como el stress hacen que nuestra piel pierda su vitalidad.\r\n\r\nTambién logramos mejorar el aspecto de la piel, removiendo  las células muertas del estrato córneo , toxinas, imperfecciones, puntos negros (comedones) y micro quistes (milium) que se van acumulando con el tiempo.\r\n\r\nCada tipo de piel requiere un cuidado diario con productos cosméticos específicos que se adapten mejor a cada necesidad. La profesional  indicará en cada caso determinadas cremas y geles para cada caso en particular.\r\n\r\n', '800.00', '0.00', 0, 0, 0, 0, 0, 0),
(1686, 101, 642, '', 'PEELING', 'Aplicando distintos ácidos de acuerdo a la necesidad de cada paciente, logramos afinar el estrato córneo así  logramos llegar a capas profundas estimulando  las fibras de colágeno , produciendo mas producción de las mismas y por ende una renovación celular.\r\n\r\nLa piel va a lucirse mas joven, luminosa y tersa.\r\n\r\nAprovecha este año a probarlo, los vas a amar.', '800.00', '0.00', 0, 5, 0, 0, 0, 0),
(1687, 97, 620, '', 'FERNET', 'MEDIDA DE FERNET Y COCA COLA', '300.00', '0.00', 0, 0, 0, 0, 0, 0),
(1688, 97, 620, '', 'GANCIA', 'MEDIDA DE GANCIA Y SPRITE', '300.00', '0.00', 0, 1, 0, 0, 0, 0),
(1689, 97, 620, '', 'CAMPARI', 'MEDIDA DE CAPARI Y JUGO DE NARANJA', '300.00', '0.00', 0, 2, 0, 0, 0, 0),
(1690, 97, 620, '', 'GIN TONIC', 'DE LIMA / LIMON / MARACUYA / FRUTILLA / FRUTOS ROJOS / PEPINO / NARANJA', '350.00', '0.00', 0, 3, 0, 0, 0, 0),
(1691, 101, 642, '', 'MICRODERMOABRASIÓN', 'Consiste en la remoción mecánica y controlada de los estratos mas superficiales de la piel.  Esta exfoliación es rápida y no utiliza agentes químicos, por eso es suave, segura, uniforme, precisa, completamente indolora y agradable.\r\n\r\nComo consecuencia, se produce la regeneración celular con incremento en la producción de colágeno, obteniendo un aumento en la elasticidad de la piel y disminución de las manchas producidas por la exposición solar, arrugas finas, siendo de elección para el tratamiento de poros dilatados, arrugas, secuelas de acné.\r\n\r\nTu piel se verá más joven, suave, tersa y limpia luego del primer tratamiento, permitiéndole retornar a sus actividades habituales en forma inmediata. La microdermoabrasión es el tratamiento estético más indicado para corregir las posibles secuelas que el acné deja en nuestra piel, así como el envejecimiento cutáneo y la hiperpigmentación facial. Se trata de una técnica de exfoliación física y superficial de la piel. (con punta de diamante.)', '800.00', '0.00', 0, 4, 0, 0, 0, 0),
(1692, 101, 642, '', 'RADIOFRECUENCIA TRIPOLAR', 'Es el tratamiento para contrarrestar  de la flaccidez, genera un estímulo en la dermis provocando un aumento de la producción de fibras de colágeno.\r\n\r\nExiste un efecto inmediato y uno a largo plazo.\r\n\r\nEfecto inmediato: al término de cada sesión podrás  notar un mejor estado de tu piel, mas liso e hidratado, más lozano y fresco y hasta la desaparición transitoria de algunas micro arrugas finas, no así de surcos o arrugas de expresión.\r\n\r\nEfecto a largo plazo: luego de varias sesiones (a partir de la 5ta o 6ta) los cambios mencionados ya son mas duraderos y comenzará a ponerse de manifiesto el tan ansiado \"efecto lifting\", una vez que el crecimiento de colágeno es suficiente como para comenzar a rellenar arrugas y mostrar un efecto tensor en tu piel. Es el tratamiento ideal para eliminar arrugas finas o moderadas y flacidez en el rostro, recuperar el volumen perdido con los años, modelar el contorno de la mandíbula, región submentoniana y cuello. También da excelentes resultados en el tratamiento de cicatrices por acné, en el caso de los poros dilatados ayuda a minimizarlos por que al disminuir la flacidez los poros son menos visibles', '800.00', '0.00', 0, 9, 0, 0, 0, 0),
(1693, 101, 643, '', 'LIPOLASER', 'Es una técnica que permite realizar procedimientos para eliminación de grasa, moldeamiento corporal y reducción de celulitis de manera no invasiva, basado en la aplicación de energía laser de manera segura (y sin dolor) a longitudes de onda y potencias muy precisas.', '0.00', '0.00', 0, 0, 0, 0, 0, 0),
(1694, 101, 643, '', 'ULTRACAVITACIÓN', 'El ultracavitador es un aparato que produce ondas ultrasónicas de alta potencia, generando cambios de presión en el líquido intersticial del tejido, lo que produce que los adipocitos implosionen\r\nEs un tratamiento reductor para adiposidad localizada\r\nAbdomen, miembros inferiores, miembros superiores, pantalón de montar.\r\n', '700.00', '4800.00', 0, 0, 0, 0, 0, 0),
(1695, 101, 643, '', 'VACUMTERAPIA', 'La vacumterapia es un tratamiento no invasivo que busca, a través de aparatos seccionadores, drenar el tejido adiposo movilizando la grasa localizada hacia el sistema linfático. Se utiliza como una alternativa para eliminar la grasa localizada, y habitualmente es un complemento con la técnica de Cavitación.', '0.00', '0.00', 0, 0, 0, 0, 0, 0),
(1696, 101, 643, '', 'RADIOFRECUENCIA', 'La radiofrecuencia consiste en la aplicación de ondas electromagnéticas de alta frecuencia sobre la piel que provoca el calentamiento controlado de las diferentes capas de la dermis, lo que favorece: La formación de nuevo colágeno. El drenaje linfático. La circulación de la piel y el tejido subcutáneo.', '0.00', '0.00', 0, 0, 0, 0, 0, 0),
(1697, 101, 643, '', 'ELECTRODOS', 'Funciona produciendo contracciones musculares en la zona en la que se aplica, generando así un efecto de entrenamiento muscular (llamada actividad física pasiva ya que se trabajan los músculos sin cardio). Así, las fibras musculares adquieren fuerza y resistencia, y se queman además las reservas de grasa localizadas.', '0.00', '0.00', 0, 0, 0, 0, 0, 0),
(1698, 101, 635, '', 'HYDRAPORE', 'Crema gel muy suave y fresca. Contiene aquaporinas que transportan el agua entre las células y mejoran el sistema de hidratación natural y la resistencia de la piel. Alivia la sensación de tirantez y brinda elasticidad y suavidad. Indicada para  toda edad y en todo tipo de piel, con muy buena tolerancia en pieles sensibles y grasas deshidratadas.', '1560.00', '1300.00', 0, 1, 0, 0, 0, 0),
