(1785, 110, 674, '', 'DESINFECTANTE 5TA GEN. MLD 5 LT', 'MLD es un limpiador desinfectante de pH neutro formulado con Amonio Cuaternario de 5ª Generación y fragancia potenciada. MLD limpia, desinfecta y desodoriza en un solo paso cualquier superficie lavable. Al ser un producto neutro, no afecta ni daña ningún tipo de superficie ni acabado.\nMLD está indicado para limpieza y desinfección en áreas públicas de hospitales y clínicas; oficinas, salones de eventos, edificios públicos, guarderías, escuelas, hoteles, spa, clubes, baños, vestuarios o en cualquier área en la cual se necesite una desinfección efectiva y una persistente y agradable fragancia. Su formulación permite un rápido secado. Disponible en fragancias MARINE FRESH, FRUTAL y FLORAL.', '1950.00', '0.00', 0, 0, 0, 0, 0, 0),
