(1793, 101, 642, '', 'DRENAJE LINFATICO FACIAL', 'El Drenaje linfático facial es una técnica de terapia manual, que consiste en movimientos suaves, de bombeo y lentos en dirección a la linfa para la eliminación de toxinas por vías naturales.\r\n\r\nSe movilizan las toxinas mediante el drenaje hacia los ganglios superficiales para luego dirigirlo hacia los profundos del cuello, que a su vez, drenan hacia la zona torácica.\r\n\r\nEl masaje de drenaje linfático facial hace que tu rostro mejore su aspecto natural y rejuvenezca ya que ayuda a la eliminación del exceso de líquidos y de las toxinas acumuladas en los tejidos.\r\n\r\nFavorece la circulación de la sangre y fortalece el tono muscular.\r\n', '800.00', '0.00', 0, 8, 0, 0, 0, 0),
(1794, 101, 642, '', 'RADIOFRECUENCIA FRACCIONADA', 'La radiofrecuencia es conocida por su capacidad de regenerar las fibras de colágeno de la piel, encargadas de mantener firme el tejido. Esta nueva tecnología entrega energía térmica de forma fraccionada en la dermis profunda, con un impacto significativo pero con una mínima afección de la capa más superficial de la piel. \r\n\r\nEn CARS estamos siempre buscando nuevas técnicas y mejores opciones para satisfacer las necesidades de nuestros pacientes, por lo que hemos integrado la Radiofrecuencia Fraccionada a nuestros tratamientos estéticos.\r\n\r\nCómo funciona\r\n\r\nPara entender las tecnologías fraccionadas es necesario imaginar y pensar en los píxeles de una foto. De la misma manera que un cuadro dañado se restaura de una pequeña parte por vez, o se corrige una imagen fotográfica punto por punto, el tratamiento fraccionado mejora la apariencia de la piel mediante miles de pequeñísimos puntos microscópicos.\r\n\r\nEl aplicador administra energía de radiofrecuencia bipolar por fracciones sobre la piel a tratar. Esta energía provoca heridas microscópicas en la epidermis sin dañar el tejido circundante y a causa de ello se inicia una fuerte respuesta de curación. El tejido menos afectado, que rodea las fracciones de piel tratada, acelera este proceso y ayuda a la recuperación y cicatrización. El resultado es una piel con aspecto más firme y rejuvenecido.\r\n\r\nEste tratamiento es indicado para tratar: arrugas finas, flacidez , arrugas de expresión y cicatrices de acné. No requiere reposo , puede que la piel quede  enrojecida por un período de 2 a 6 horas aprox.  y es ideal para tratar procesos intermedios de envejecimiento.\r\nEntrega resultados superiores con una sensación de dolor muy baja, ofreciendo un tratamiento muy seguro, pudiendo tratar, cara, cuello, escote, manos\r\n\r\nPara qué casos se utiliza:\r\n\r\nRejuvenecimiento facial\r\nMejora de la textura y tono de la epidermis\r\nCorrección de cicatrices de acné\r\nTensado de piel\r\nReducción de cicatrices\r\nEfecto de lifting de la piel\r\nEstrías rojas/moradas\r\n\r\nReparar la piel, punto por punto\r\n\r\nTras años de investigación, se descubrió que al tratar la piel por milimétricas fracciones, la respuesta biológica de curación resultaba ser mucho más rápida y que, por lo tanto, el tiempo de recuperación del paciente se reducía considerablemente.\r\n\r\nEste método proporciona una piel más suave y sana al tiempo que mejora el tono, el color y la elasticidad desde la primera sesión. Consiste en la emisión de miles de minúsculos haces, que penetran en la piel a modo de profundas columnas térmicas. Estas columnas se convierten en zonas de micro-lesiones separadas por tejido sano; es decir, por células con capacidad para promover una rápida cicatrización, las mismas empezarán rápidamente el proceso natural de regeneración de tejido nuevo y sano, renovando la epidermis.\r\nPuede quedar lesiones en la epidermis por unos días, las cuales se regeneran en piel nueva, esto la profesional queda de acuerdo con vos para ver hasta que profundidad se trabaja.', '800.00', '0.00', 0, 10, 0, 0, 0, 0),
(1795, 101, 642, '', 'ELECTROPORACION', 'Mediante la electroporación, se altera de manera transitoria la permeabilidad de la membrana plasmática lo que ocasiona la apertura de los canales intracelulares y posibilita la introducción de activos preparados especialmente para usar con este tipo de aparatología.\r\n\r\nLa electroporación también abre finísimos canales en la epidermis a través de los lípidos del espacio intercelular. Esta vía es quizás la más importante en las aplicaciones estéticas de esta tecnología, ya que permite el paso de sustancias a través de la piel.\r\n\r\nLa electroporación provoca un reacomodamiento físico de las células de la piel. Al ser la corriente de electroporación alternada (o sea que cambia de dirección permanentemente) logramos que este reacomodamiento sea continuo, y que vaya generando nuevos poros y canales mientras la corriente esté activa.\r\n\r\nLa electroporación permite introducir tanto micro como macromoléculas, inclusive mayores a 800.000 Dalton como el ácido hialurónico, o de 500.000 Dalton como el colágeno.\r\n\r\n Beneficios!\r\n? Tratamiento totalmente ambulatorio.\r\n? No duele ni deja marcas.\r\n? Ideal para quienes tienen miedo a las agujas en a la aplicación de Mesoterapia Médica tradicional.\r\n? Es un tratamiento multipropósito en donde, según el objetivo, se utilizaran distintos principios activos como colágeno, elastina, equisetum, Argireline®, etc.\r\n\r\nEste tratamiento esta indicado para las siguientes afecciones:\r\n Rejuvenecimiento Facial - Antiaging.\r\n Líneas de expresión.\r\n Flaccidez cutánea facial\r\nHidratación Profunda\r\nDespigmentación\r\n\r\n', '800.00', '0.00', 0, 6, 0, 0, 0, 0),
(1796, 101, 642, '', 'LIPOLASER', 'Se usa para la reducción de papada cuando es por adiposidad.\r\nActúa sobre los adipocitos debilitando sus membranas', '500.00', '0.00', 0, 7, 0, 0, 0, 0),
(1797, 101, 642, '', 'MICRONEEDLING/DERMAPEN', ' Esta técnica es una de las más novedosas en  Estética. Ya que consigue gracias a una pequeñas agujas que tienen, prevenir la aparición de arrugas en tu piel, ofreciendo una piel más joven y consiguiendo que tus productos de rutina de belleza facial sean mucho más efectivos.\r\n\r\nEn CARS  Medicina Estética trabajamos la técnica de Microneedling, con Dermapen  Es un  tratamiento seguro, se desliza suavemente por la piel provocando suaves punciones en las capas más superficiales, con esto conseguimos reparar los posibles daños que pueda tener y ella misma comienza a producir colágeno de forma natural. El colágeno lo tenemos en nuestro cuerpo de forma natural, y a medida que envejecemos, este va desapareciendo, porque el cuerpo produce menos. Gracias al microneedling , conseguimos que aumente la producción de colágeno en la piel, consiguiendo un aspecto mas joven\r\n\r\n¿Por qué los productos de cuidado en casa funcionan mejor después de este tratamiento?\r\n\r\nLas microperforaciones que genera el microneedling permiten que los productos para el cuidado de la piel, sobre todo los serums, penetren mejor y sean, por tanto, más eficaces. \r\n\r\n¿Para que está indicado este tratamiento además de ser un plus para prevenir el envejecimiento de la piel? La mayoría de la personas que buscan este tratamiento además de quererlo para prevenir el envejecimiento, lo requieren para reducir estrías, mejorar cicatrices como las producidas por el acné y mejorar las imperfecciones de la piel.\r\n', '2000.00', '0.00', 0, 3, 0, 0, 0, 0),
(1798, 101, 642, '', 'HIGIENE FACIAL CON EXTRACCION DE COMEDONES ', ' Preparación de la piel\r\n \r\nLimpieza y exfoliación, puede ser manual y/o\r\nmicrodermoabrasión con punta de diamantes, mascara queratolitica, extracción de comedones, ozonoterapia, mascara descongestiva, serum antioxidante, hidratación y foto protección.\r\n\r\nTratamiento facial completo donde eliminaremos impurezas, aportaremos hidratación restableciendo el brillo y lozanía de la piel.\r\n\r\nLas sesiones son una vez por semana o cada 15 días dependiendo de cada persona y el abordaje del tratamiento puede variar\r\n\r\n \r\n\r\n \r\n\r\n', '1000.00', '0.00', 0, 1, 0, 0, 0, 0),
(1799, 101, 642, '', 'HIGIENE FACIAL CON EXTRACCION DE QUISTES MILIUM', 'Preparación de la piel\r\nHigiene\r\nExfoliación\r\nExtracción de los  Milium\r\nSe continua la sesión, según lo que tu piel necesita, mascara, hidratación, FPS\r\n\r\n', '1000.00', '0.00', 0, 2, 0, 0, 0, 0),
(1800, 101, 642, '', '4 SESIONES FACIALES', 'Abonando 4 sesiones faciales de cualquiera de las siguientes\r\nHigiene facial,\r\nMicrodermoabrasión,\r\nRadiofrecuencia Tripolar, Radiofrecuencia Fraccionada, Electroporación,\r\n  las combinamos según tu necesidad\r\n \r\n\r\n\r\n', '3200.00', '2800.00', 0, 0, 0, 0, 0, 0),
