(1914, 20, 495, '', 'CHENIN DULCE NATURAL LATA', 'Color: Amarillo verdoso de buena intensidad.\r\n\r\nAroma: Las principales notas aromáticas de este vino son durazno blanco, damasco, hierbas frescas y algunas notas cítricas como limón y pomelo. Aroma muy intenso y delicado.\r\n\r\nSabor: En el sabor se distinguen una entrada dulce, notas cítricas, con un buen equilibrio entre la acidez y el azúcar natural. Es justamente el azúcar natural el que le da untuosidad y largo final.', '300.00', '0.00', 0, 45, 0, 0, 0, 1),
