(1916, 0, 695, '', 'GLENMORANGIE SIGNET', 'Whisky escocés de la region de highland. Es la culminación de la dedicación de 170 años de la destilería para elaborar whiskys de prestigio. Se trata del primer whisky elaborado a base de cebada chocolate, altamente tostada.\r\nWhisky sin filtrar en frío, abv 46%', '62800.00', '0.00', 0, 0, 0, 0, 0, 0),
