(3123, 131, 868, '', 'SABANA PIÑATA', 'Sábanas Ultra Soft 1 1/2 Plaza Cars\r\nEl juego de sábanas incluye tres piezas. Cada pieza tiene un diseño único y divertido.\r\nCon funda reversible para combinarla como quieras.\r\nSu nueva tela ultra soft brinda el máximo confort de suavidad al tacto.\r\nEsta nueva tecnología exclusiva de Piñata permite que sean hipoalergénicas, no destiñen, no necesitan planchado y posee antipeeling, para que no se produzcan pelotitas con los múltiples lavados.\r\nSus colores más vibrantes y resistentes a los lavados lucirán siempre como nuevas.\r\nCon línea Piñata Ultra Soft los niños podrán descansar, divertirse y sentir la máxima suavidad en su piel\r\n\r\nMedidas:\r\nSábana Superior: 150 x 240 cm.\r\nSábana Ajustable: para colchón de hasta 90 x 190 x 25 cm.\r\nFunda: 48 x 76 cm.\r\n', '2100.00', '0.00', 0, 0, 0, 0, 0, 0),
