(5197, 159, 1161, '341', 'CANDADO CON ALARMA', 'Candado con sirena de alarma a 110 decibeles.\r\nResistente al agua e intemperie,el sistema de cierre puede ser utilizado con alarma o sin alarma. Alarma de 2 tonos con rearme automático, procesado y endurecido, acero inoxidable y antigiro de grillete, cuerpo de aleación de zinc, resistente a la corrosión, resistente a la sal y el clima duro, anti taladro. Requiere de 6 pilas tipo botón LR-44 (incluidas)\r\nCaracteristicas:\r\n* Sistema de alarma y bloqueo.\r\n* Sirena de 110 decibeles.\r\n* Dos tonos de alarma.\r\n* Reset automático.\r\n* Sensor de choque y movimiento.\r\n* Resistente a la corrosión y a la intemperie.\r\n* La alarma suena en intervalos de 10 segundos.\r\n* A prueba de agua\r\n* Material: acero.\r\n* Incluye 6 pilas LR-44 y 3 llaves.\r\n* Medida Total con aro cerrado 13 Cm.\r\n* Medida de enganche 7.5 Cm.', '2490.00', '0.00', 0, 7, 0, 0, 0, 1),
(5198, 159, 1161, '342', 'LUZ LED COB RECARGABLE', 'LUZ DE BICI TRASERA / DELANTERA RECARGABLE USB:\r\n Medidas: 8.5cm (largo) x 2cm (ancho - 3cm hasta soporte) x 1.5cm (alto).\r\n* Peso: 40gr.\r\n* Leds C.O.B de 100 Lumens.\r\n* Recargable x USB (no cargar mas de 5v).\r\n* Batería de Polímero de Litio de 3.7v 500mAh.\r\n* Duración Aprox. de Carga 4hs (dependiendo del uso).\r\n* INCLUYE: Cable de Carga USB.\r\nBanda de Silicona Elástica para ajustar.', '1790.00', '0.00', 0, 8, 0, 0, 0, 1),
(5199, 159, 1130, '343', 'MINI SELLADORA ', 'Descripción\r\n* Fácil, cómodo de usar y de almacenamiento, ideal para el hogar uso.\r\n* Perfeccione las porciones de comida no utilizadas, mantenga la comida en frescura.\r\n* Simplemente deslícela a lo largo del borde de cualquier bolsa y se sella herméticamente.\r\n* Proporcione protección contra la marea, a prueba de moho .\r\n* Un imán en la base puede adsorberse en la superficie del metal.\r\n* Abra la tapa para precalentar el elemento presionando 5 segundos antes de usar.\r\nFUNCIONA CON PILAS 2 AA no includas\r\n\r\n', '449.00', '0.00', 0, 5, 0, 0, 0, 1),
(5200, 159, 1130, '344', 'BATIDORA MINI A PILAS', '– Facil de usar y de limpiar.\r\n– Ultra liviano, Fácil de Transportar.\r\n– Bate cualquier liquido en segundos\r\n– Mango ergonómico, super cómodo.\r\n– Ideal para tener siempre en la cocina o bien llevarlo de camping\r\n– Para preparar rapidamente el chocolate de los chicos !!!\r\n– Utilizado también por Barmans para preparar Tragos batidos.\r\nCARACTERISTICAS:\r\n* ALIMENTACION: 2 pilas AA (No incluidas)\r\n* COLOR: se entrega según stock disponible\r\n* MATERIAL: Plástico y Metal.\r\n* MEDIDA: 20 cm. de Largo x 5 cm. de ancho aprox', '449.00', '0.00', 0, 12, 0, 0, 1, 0),
(5201, 159, 1161, '345', 'LUZ CON BOCINA RECARGABLE', 'Potente luz led con bocina incorporada para viajar con seguridad en cualquier hora del día y lugar\r\n\r\nSúper luminosa y ligera con una potente y duradera batería recargable vía USB\r\n\r\n\r\n- Brillante luz LED con 3 modos de iluminación: fuerte, suave y luz intermitente\r\n- Luz de 250 LM\r\n- Puede ser utilizado como un faro de bicicleta de montaña gracias a su gran potencia\r\n- Duradera batería recargable mediante cable USB\r\n- Rinde 2.5 hs en modo de iluminación máxima, 5hs en luz media y 3.5hs en modo intermitente\r\n- Potente bocina que emite 140db incorporada con botón, ideal para usar mientras se conduce en la vía pública\r\n- El kit incluye: linterna, correa y cable de carga Micro USB\r\n- Batería de litio recargable de 1200mAh\r\n', '1390.00', '0.00', 0, 5, 0, 0, 1, 0),
(5202, 159, 1161, '346', 'HOLDER BICI ESTUCHE', 'Descripción\r\n- Anti-vibración y acolchado.\r\n- Se adapta a cualquier bicicleta, moto, cuatriciclo.\r\n- Se adapta a casi todos celulares, iPODs y GPS.\r\n- Medidas: 17 cm x 10 cm\r\n- Eje y perno de acero.\r\n- Gira 360°\r\n- Inclinación regulable.\r\n- Se monta y desmonta en segundos.\r\n- Gomas internas para regular el diámetro.\r\n- Apertura hasta 9.5 centímetros.\r\n- 17cm Largo x 10cm Ancho', '4190.00', '0.00', 0, 5, 0, 0, 0, 0),
