(5204, 159, 1161, '703', 'ALFORJA PARA BICI DOBLE', 'Bolso lateral portaequipaje doble para bicicleta. A prueba de agua. Cintas reflectivas para mayor visualizacion nocturna. Ambos laterales tienen un bolsillo frontal con cierre para transportar cosas mas pequeñas. Capacidad: 46lts. Medidad: 33x45x16cm.', '24490.00', '0.00', 0, 1, 0, 0, 0, 0),
(5205, 159, 1318, '906', 'PAELLERA + CUCHARA + AZAFRAN CRISTAL', 'Excelente Paellera con Asas. \r\nDiametro 26 Cms, cuchara de madera y Caja Cristal de 0.35 gramos de Azafrán en Hebras.\r\n', '9900.00', '0.00', 0, 0, 0, 0, 0, 0),
