(5255, 151, 1331, '', 'DIPLOMATURA EN EDUCACIÓN Y MEDIOS, SELECCIÓN Y EVALUACIÓN DE MEDIOS EDUCATIVOS', 'DURACION 6 MESES <br>MODALIDAD ON LINE <br>FECHA DE INICIO INICIA YA <br>PUNTOS POR PROVINCIA: Buenos Aires: 3 puntos ( RESFC-2018-4265-GDEBA-DGCYE / Dictamen Provincia de Buenos Aires N 10269 ) CABA: 2 puntos ( 28101431-MGEYA-DGPLEDU-18 ) Santa Fe: 28 puntos ( DECRETO-3029 / DECRETO-MODIFICATORIO-2552 ) Entre Ríos: 5 puntos ( 1000-13-CGE ) Río Negro: 0.20 puntos ( Resolución N 4413/18 ) Resto del País: Las Diplomaturas Superiores de la Facultad de Ciencias de la Educación de la Universidad FASTA son postítulos que se dictan de acuerdo a los considerandos de la Resolución del Consejo Federal de Educación N 117/10. Todas las Diplomaturas acreditan una duración mínima de 600 horas reloj. ', '0.00', '0.00', 0, 0, 0, 0, 0, 0),
