(5516, 142, 1363, '533', 'REFLECTOR SOLAR COB', 'Reflector solar led 6 COB.con sensor movimiento con controlador panel solar con led separado. cable 5 mts.\r\nPotencia: 300W.\r\nMaterial: ABS.\r\nFuente de luz: 6 * COB.\r\nFunción: detección de movimiento.\r\nDistancia de inducción: 5-8 m/16,4-26,2 pies.\r\nMétodo de instalación: agujero para colgar en la pared.\r\nPaneles solares: polisilicio de alta calidad, 5,5-6,5 V 1W.\r\nBatería: 1200mAh 3,7 V batería de litio, recargable.\r\nHoras de trabajo: carga 6 horas durante el día y trabajo más de 10 horas por la noche.\r\n1X lámpara Solar.\r\n1X manual en inglés.\r\nEs fácil de instalar sin tirar de los cables. Solo es necesario fijar el producto en la pared con un tornillo.\r\nLámpara Solar al aire libre, utilizando la energía del sol para su iluminación nocturna.\r\nDurante el día, la luz no está encendida, solo por la noche enciende el interruptor, cuando el sensor detecta que el cuerpo humano puede obtener luz de alto brillo.\r\nLámpara solar IP65 resistente al agua y al calor, adecuada para la mayoría de los tipos de clima.\r\nLas luces solares al aire libre iluminan su jardín, patio, pasillo, porche, patio o entrada, etc.\r\nPor la noche modo de detección, la gente se enciende, la gente se apaga.\r\nModo de inducción por la noche, la gente se enciende, la gente camina ligeramente brillante.', '1990.00', '0.00', 0, 0, 0, 0, 0, 0),
