(6804, 159, 1137, '', 'CEPILLO SACA PELOS PELUSA QUITA PELOS DE MASCOTAS', 'PACK DE 2 CEPILLOS\r\nCepillos Quita Pelos De Mascota Saca Pelusas\r\nIncluye:\r\n1 Cepillo grande.\r\n1 Cepillo chico.\r\nElimina pelos y las pelusas de las mascotas de forma rápida y sencilla. Simplemente deslice para limpiar, sumerja en la base de auto limpieza para retirar los restos de pelo.\r\n\r\nEl cepillo de doble cara de te permite limpiar en la mitad del tiempo\r\nEl secreto son las miles de micro cerdas que actúan como dedos agarrando hasta la última pieza de pelusa o piel.\r\n\r\nIdeal para muebles tapizados, ropa, alfombras, ropa de cama, almohadas, asientos de tela y más.\r\nNo se necesitan recambios, ¡úsala una y otra vez!', '3990.00', '0.00', 0, 0, 0, 0, 0, 0),
(6805, 159, 1157, '', 'ZAPATILLA 5 TOMAS 2 USB', '5 TOMAS + 2 USB HEXAGONAL\r\n\r\n* COLOR ROSA, AZUL Y NARANJA !!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!\r\n* Zapatilla Múltiple con Tomas Universales + Puertos usb.\r\n* Formato Hexagonal.\r\n* Longitud del Cable: 1.80m.\r\n* Tensión Nominal: AC 250v.\r\n* Corriente Nominal: 10am.\r\n* Toma Corriente de 10am.\r\n* Salida USB: 5v 1 ~ 2.1 am.\r\n', '4990.00', '0.00', 0, 3, 0, 0, 0, 1),
(6806, 159, 1157, '', 'ZAPATILLA ELECTRICA ALARGUE EXTENSOR 2 ENCHUFES 3 USB 1,8MTS', 'ZAPATILLA DE CARGA 3PUERTOS USB + 2 TOMAS 220V (Universales)\r\n\r\nCable de1,8 ultra reforzado\r\nPuertos USB\r\n2 Tomas eléctricas universales y antiestáticas\r\nTerminación delicada', '4990.00', '0.00', 0, 4, 0, 0, 0, 1),
(6807, 159, 1157, '', 'REFLECTOR LUZ SOLAR CON CONTROL SENSOR MOVIMIENTO EXTERIOR', 'Características:\r\n3 modos de iluminación : esta luz led solar para exteriores tiene 3 modos de iluminación: Mode1: Luz de brillo completo con Sensor de movimiento. Mode2: brillo medio + sensor de movimiento Luz de brillo completo. Mode3: luz constante en la oscuridad. El botón de modo a través fácil de elegir cumple con sus diferentes requisitos, le permite disfrutar de un estilo de vida más conveniente y ecológico.\r\nDiseño ajustable: ángulo de movimiento de 180 °, para que pueda ajustar el ángulo del panel solar para una mejor exposición diurna. El ángulo flexible puede satisfacer diferentes necesidades.\r\nResistencia al clima : el material está hecho de ABS de alta calidad. Tiene resistencia al calor y la función impermeable IP65 puede proteger completamente el circuito y la batería recargable, y también puede soportar cualquier tipo de clima horrible como una tormenta, tormenta, escarcha o calor diario en mucho tiempo.\r\n\r\n\r\nEspecificación:\r\n. Panel solar: 5,5 v/2,5 w\r\n. Material: ABS\r\n-- Batería: batería de litio de 1200mah\r\n. A prueba de agua: IP65\r\n_MEDIDA REFLECTOR SOLO 21 CM ALTO 15 CM ANCHO\r\n_ MEDIDA DEL SOPORTE DE PARED 18 CM ALTO 2.5CM DE ANCHO', '4390.00', '0.00', 0, 0, 0, 0, 0, 1),
(6808, 159, 1157, '', 'PARLANTE BLUETOOTH PANTALLA SOLAR USB LUZ EMERGENCIA FM CARGADOR', 'Sistema de energía de energía solar de alta calidad que carga el panel solar para el sistema de iluminación del hogar con luz led, altavoz bluetooth, radio FM\r\n\r\nKir de emergencia YX-168BT\r\n\r\nTamaño del producto: 172*70*225mm\r\n\r\nKit completo que incluye\r\n1 Central con Parlante y multimedia,\r\n1 panel solar,\r\n\r\nEsta unidad incorpora batería de plomo ácido de 4500MHA\r\n\r\nPanel solar policristalino de 6V 3W, buena calidad 25° Solar spectrum AM 1.5\r\n\r\nEste artículo se puede usar en casa para iluminación Emergencias o iluminación de campamento.\r\n\r\nFunción:\r\nFuente de alimentación solar,\r\nRadio FM,\r\nParlante bluetooth,\r\nReproducción de tarjetas TF y USB\r\nLinterna Led\r\nPanel Luminoso Led\r\n\r\nCargando\r\ncargado por panel solar o cargador de CA (Enchufe no incluido)\r\n\r\nFunción\r\nSalida USB, iluminación LED, linterna, radio FM, altavoz bluetooth, lectura de tarjetas TF y USB, etc.\r\n\r\nMaterial Plastico\r\nVoltaje de Salida 3v / 5V\r\nCapacidad Bateria 4500Mha\r\nDuracion modo Parlante 5 - 10hs\r\nTiempo de funcionamiento luz emergencia 5h', '18900.00', '0.00', 0, 2, 0, 0, 0, 1),
(6809, 159, 1157, '', 'SISTEMA DE ENERGÍA DE ENERGÍA SOLAR DE ALTA CALIDAD QUE CARGA EL PANEL SOLAR PARA EL SISTEMA DE ILUM', 'Descripción\r\n\r\nTecnología LED COB mejorada: Los LED COB (chip a bordo) son la última y más avanzada tecnología del mercado hoy en día. Puede aumentar más de 3 veces el área de iluminación, por lo que evita el deslumbramiento incómodo en la medida máxima. Los LED COB son más brillantes y suaves, consumen menos energía y emiten un haz de luz de mayor calidad en comparación con las tecnologías LED tradicionales.\r\n\r\nModo de iluminación:\r\n\r\n1. Modo activado por movimiento (se activa a un brillo completo durante 20 segundos, solo cuando se detecta movimiento).\r\n\r\nDiseño de panel solar separado: La lámpara solar de pared de NACINIC tiene un panel solar más grande y separado. Con cable de 16.4 pies, puedes poner el panel solar en un lugar abierto para recibir más luz solar. Con las luces solares NACINIC para exteriores no tienes que pagar más en las facturas eléctricas, ahorran dinero y son ecológicas.\r\n\r\nLuces solares impermeables IP65, sensor de movimiento para exteriores: Hechas de ABS de alta resistencia, están específicamente diseñadas para soportar condiciones climáticas extremas. Ahorro de tiempo: Fáciles de instalar en 5 minutos, puedes instalar las luces con los tornillos incluidos en cualquier lugar en interiores o exteriores. Ideal para poner en áreas sin toma de corriente.\r\n\r\nCaracterísticas\r\n\r\n• Chips LED: 6 COB\r\n• Temperatura del color: 6000°K Blanco Frío\r\n• Tiempo de carga: En 8 horas (día soleado de aproximadamente 25°C)\r\n• Tiempo de trabajo: De 6 a 8 horas después de la carga completa\r\n• Angulo de iluminación: 120°\r\n• Humedad de funcionamiento: 10-90%\r\n• Temperatura trabajo: 0-40°C\r\n• Color: Negro\r\n• Material: Plástico ABS\r\n• Dimensiones Reflector: 150 x 110 mm\r\n• Dimensiones Panel: 129 x 114 mm\r\n• Largo Cable de conexion: 5 metros\r\n• Nivel de protección: IP65 Apto exterior\r\n• Vida útil: 50.000 h\r\n• Origen: China\r\n\r\nProducto Incluye\r\n\r\nLámpara Solar LED 6 COB con Sensor de Movimiento', '12900.00', '0.00', 0, 0, 0, 0, 0, 1),
(6810, 159, 1141, '', 'SOPORTE CARGADOR RAPIDO INALAMBRICO AUTO SENSOR INTELIGENTE ', 'SOPORTE AUTO CARGADOR CELULAR INALAMBRICO WIRELESS\r\n\r\nVoltaje de entrada 5V 2A, 9V 1.67A\r\nAltura 14 cm\r\nAncho 9 cm\r\n\r\nCargador del coche inalámbrico con sujeción automática del celular ( Detecta la cercania del celular y abre sus brazos de sujeción automaticamente ) para iphone , 8, X, 8plus . Android Samsung S6, S7, S7edge, S8, S8+, S9+. Air vent soporte para teléfono 360 grados de rotación de carga.\r\n\r\nCompatible con cargadores de tecnologia QI.\r\nNo es necesario manipularlo para lograr el ajuste, abre sus brazos y sujeta el celular automáticamente.\r\n\r\nDuradero y practico\r\nDetección automática de infrarrojos y operación con una sola mano, Funciona con la mayoría de los teléfonos inteligentes, independientemente del tamaño o la forma', '5900.00', '0.00', 0, 0, 0, 0, 0, 0),
