(6842, 159, 1665, '', 'ADIDAS ULTRA BOOST TALLE 8.5 (39.5)', 'Talle 8.5\r\n¿Qué es Boost?\r\n\r\nEs difícil pensar en adidas sin pensar en Boost, la revolucionaria tecnología de amortiguación y alto rendimiento presente desde 2013 en una gran variedad de zapatillas adidas. Boost marcó un antes y un después en el mundo de las zapatillas. Su tecnología de retorno de energía supuso una innovación que cambiaría por completo el rumbo del running. Hoy adidas continúa trabajando en su tecnología Boost y llevando el concepto más lejos todavía.', '110.00', '0.00', 0, 0, 0, 0, 0, 0),
