(7307, 159, 1733, '', 'BABY CALL MOTOROLA VM75', 'El Motorola VM75 es un monitor para bebés fácil de usar con todo lo que necesitas. Obtén una vista clara de tu pequeño en la pantalla grande de 5\". Utiliza la función de escaneo panorámico remoto y la inclinación digital para supervisar toda la habitación y acercarte al bebé para obtener una mejor vista. Siempre escucha lo que sucede en la guardería con la función de comunicación bidireccional, y habla con tu bebé sin tener que estar en la habitación. Controla la temperatura de la habitación de la guardería para asegurarte de que tu pequeño esté siempre cómodo. Escucha a tu bebé cuando te necesita con el micrófono de alta sensibilidad y elige entre las 5 canciones de cuna preinstaladas para calmarlo y ayudarlo a dormir. Las cámaras de nuestro monitor de video para bebés están equipadas con micrófonos de alta sensibilidad que pueden captar los sonidos más leves, alertándote cuando tu bebé comienza a despertarse. PANTALLA A COLOR DE 5.0\": Utiliza la pantalla grande de 5.0\" para obtener una vista clara y cercana de tu pequeño y controlar las funciones de la cámara. CÁMARA REMOTA DE ESCANEADO PANORÁMICO VGA: Cámara motorizada de inclinación digital CONEXIÓN SEGURA Y PRIVADA: Duerme tranquilo sabiendo que tu conexión es segura y privada. MONITOREO DE LA TEMPERATURA DE LA HABITACIÓN: Controla la temperatura de la habitación para asegurarte de que la guardería sea cómoda para tu bebé. COMUNICACIÓN BIDIRECCIONAL: Habla y escucha a tu pequeño con la función de comunicación bidireccional. CANCIONES DE CUNA: Disfruta de las 5 canciones de cuna preinstaladas para calmar a tu bebé. ALCANCE DE HASTA 1,000 PIES: Mantente conectado en toda tu casa. VISIÓN NOCTURNA POR INFRARROJOS: Las luces LED infrarrojas en las cámaras te permiten ver a tu pequeño con claridad, tanto de día como de noche. MICRÓFONO DE ALTA SENSIBILIDAD: No te pierdas ni un sonido de tu bebé con nuestro micrófono de alta sensibilidad. INDICADOR DE NIVEL DE SONIDO LED: Incluso con el sonido apagado, sabrás cuándo se despierta tu bebé con nuestro indicador de nivel de sonido LED. UNIDAD PARA PADRES: Pantalla a color de 5.0\" y 480 x 272 / Unidad para padres recargable con tecnología inalámbrica FHSS de 2.4 GHz.', '200.00', '0.00', 0, 0, 0, 0, 0, 0),
(7308, 159, 1250, '', 'PAELLERA DE 27 CMS DE DIAMETRO', '¡Paellera de 27 cm de diámetro y 5 cm de alto! Perfecta para cocinar deliciosas paellas para toda la familia. Hecha con materiales de alta calidad para una cocción uniforme y duradera. \r\nIncluye todo lo que necesitas para empezar a cocinar:\r\nCuchara de madera resistente, ideal para mezclar y servir tus platos con estilo tradicional.\r\nLibro de recetas con las mejores sugerencias y consejos para preparar paellas auténticas y deliciosas. ¡Explora nuevas combinaciones y sorprende a tus invitados! ????\r\nAzafrán en hebras de alta calidad, para agregar el toque perfecto de sabor y color a tus creaciones culinarias. Un ingrediente imprescindible para auténticas paellas españolas. \r\n¡Todo este increíble conjunto por solo $15.000! ¡No pierdas la oportunidad de llevar la experiencia culinaria española a tu hogar! ', '15000.00', '0.00', 0, 0, 0, 0, 0, 0),
